import React, { useState, useEffect } from "react";
import { BrowserRouter as Router, Routes, Route, Navigate } from "react-router-dom";
import VLibras from "@djpfs/react-vlibras";

// üîπ Importa API local
import { login, logout, getBooks, getUsers, getLoans, getCurrentUser } from "./Api";

// üîπ Importa componentes
import LoginForm from "./components/LoginForm";
import BookList from "./components/BookList";
import BookForm from "./components/BookForm";
import UserForm from "./components/UserForm";
import LoanForm from "./components/LoanForm";
import AccessibleHeader from "./components/AccessibleHeader";
import Footer from "./components/Footer";

import "./App.css";

export default function App() {
  const [user, setUser] = useState(null);
  const [books, setBooks] = useState([]);
  const [users, setUsers] = useState([]);
  const [loans, setLoans] = useState([]);
  const [loading, setLoading] = useState(false);

  // üîπ Busca usu√°rio atual se houver token
  useEffect(() => {
    const initAuth = async () => {
      const currentUser = await getCurrentUser();
      if (currentUser) setUser(currentUser);
    };
    initAuth();
  }, []);

  // üîπ Ap√≥s login, carrega dados iniciais
  const handleLogin = async (credentials) => {
    setUser(credentials);
    await refreshAllData();
  };

  // üîπ Logout
  const handleLogout = () => {
    logout();
    setUser(null);
    setBooks([]);
    setUsers([]);
    setLoans([]);
  };

  // üîπ Atualiza todos os dados sem recarregar
  const refreshAllData = async () => {
    if (!user) return;
    setLoading(true);
    try {
      const [bookList, userList, loanList] = await Promise.all([
        getBooks(),
        getUsers(),
        getLoans(),
      ]);
      setBooks(bookList);
      setUsers(userList);
      setLoans(loanList);
    } catch (err) {
      console.error("Erro ao carregar dados:", err);
    } finally {
      setLoading(false);
    }
  };

  return (
    <Router>
      <div className="App">
        <VLibras forceOnload={true} />
        <AccessibleHeader user={user} onLogout={handleLogout} />

        <main>
          <Routes>
            <Route
              path="/login"
              element={
                user ? (
                  <Navigate to="/books" />
                ) : (
                  <LoginForm onLogin={handleLogin} />
                )
              }
            />

            <Route
              path="/books"
              element={
                user ? (
                  <>
                    <BookForm onBookSaved={refreshAllData} />
                    <BookList isLoggedIn={true} refreshBooksParent={setBooks} />
                  </>
                ) : (
                  <Navigate to="/login" />
                )
              }
            />

            <Route
              path="/users"
              element={
                user ? (
                  <UserForm onUserSaved={refreshAllData} />
                ) : (
                  <Navigate to="/login" />
                )
              }
            />

            <Route
              path="/loans"
              element={
                user ? (
                  <LoanForm onLoanSaved={refreshAllData} />
                ) : (
                  <Navigate to="/login" />
                )
              }
            />

            <Route
              path="/"
              element={<Navigate to={user ? "/books" : "/login"} />}
            />
          </Routes>
        </main>

        {loading && (
          <div className="loading-overlay">
            <p>‚è≥ Atualizando dados...</p>
          </div>
        )}

        <Footer />
      </div>
    </Router>
  );
}
